def num_routes(n, m):
    # Create a 2D array to store the number of routes
    routes = [[0 for _ in range(m+1)] for _ in range(n+1)]

    # There is only one route to reach any cell in the first row or first column
    for i in range(n+1):
        routes[i][0] = 1
    for j in range(m+1):
        routes[0][j] = 1

    # For other cells, the number of routes is the sum of the number of routes
    # to reach the cell above it and the cell to the left of it
    for i in range(1, n+1):
        for j in range(1, m+1):
            routes[i][j] = routes[i-1][j] + routes[i][j-1]

    return routes[n][m]

