# We can find out the number of repeating decimals by finding out the denominator of the simplified fraction form of n/(n+1)
# If the denominator of the simplified form has only 2 and 5 as prime factors, then it's a terminating decimal
# Otherwise, it's a repeating decimal.

def gcd(a, b):
    while b != 0:
        a, b = b, a % b
    return a

def simplified_denominator(n):
    g = gcd(n, n+1)
    return (n+1) // g

