def game(n, first_turn):
    # initial list of numbers
    numbers = [i for i in range(1, n+1)]
    # remove first_turn from the list and add to Carolyn's sum
    numbers.remove(first_turn)
    carolyn_sum = first_turn
    # Paul's turn, he removes all divisors of first_turn
    for number in numbers.copy():
        if first_turn % number == 0:
            numbers.remove(number)
    # continue the game
    while numbers:
        for number in numbers.copy():
            # check if number has a divisor in the list
            if any(number % i == 0 for i in numbers if i != number):
                # Carolyn's turn, she removes the number
                numbers.remove(number)
                carolyn_sum += number
                break
        else:
            # no number has a divisor, game over
            break
        # Paul's turn, he removes all divisors of the last number Carolyn removed
        for number in numbers.copy():
            if carolyn_sum % number == 0:
                numbers.remove(number)
    return carolyn_sum

