def count_multiples():
    # Initialize count as 0
    count = 0
    # Iterate over all pairs (i, j)
    for i in range(100):
        for j in range(i+1, 100):
            # Check if 10^j - 10^i is a multiple of 1001
            if (10**j - 10**i) % 1001 == 0:
                count += 1
    return count

